import React, { Component } from 'react';
import { CnxtConsumer } from './ContextComp'

export default class CompC extends Component {
    render() {
        return ( <
            CnxtConsumer >
            <
            div > {
                (name) => {
                    return <div >
                        Hawraa { name } <
                        /div>
                }
            } < /div> < /
            CnxtConsumer >
        );
    }
}
